script: |
  super -f text -I q3556.spq | sort > q3556.out

inputs:
  - name: q3556.spq
    data: |
      SELECT DISTINCT tab1.col2 + tab1.col2 / - col0 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT - col0 - - col2 IN ( col2 + - col0 * col0 );
  - name: tab1

outputs:
  - name: q3556.out
    data: |
      36
      57
      95
